INSERT INTO `wp_affiliate_wp_notifications` ( `id`, `remote_id`, `title`, `content`, `buttons`, `type`, `conditions`, `start`, `end`, `dismissed`, `date_created`, `date_updated`) VALUES
(1, 124, 'Valentine’s Day Sale', 'We’re spreading the Valentine’s Day love by offering <strong>65% OFF</strong> when you upgrade to our Professional plan. It’s the perfect time to unlock AffiliateWP’s most powerful conversion-focused addons, but you’ll have to act quick! Sale ends Friday, 17th of February at 11:55 pm.', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/account\\/downloads\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=valentines-day-2023&utm_content=go-pro-today","text":"Go Pro Today!"}]', 'success', '["personal","plus"]', '2023-02-13 20:55:01', '2023-02-17 23:55:00', 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(2, 121, 'Maximize Your Marketing Efforts with Creative Categories', 'Streamline your affiliate program by organizing creatives into custom categories. Provide an effortless experience for your affiliates, allowing them to easily find and utilize the creatives they need for optimal engagement and conversions.', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/affiliate-creative-categories\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=2.12.0-release&utm_content=learn-more","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(3, 119, 'Unleash the Power of WPForms and Boost Affiliate Signups', 'Start using WPForms, the best WordPress form builder, to build and manage your affiliate registration forms. Our newest and most powerful way to create affiliate registration forms can revolutionize the way you attract and manage affiliates - you’ve got to check it out!', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/skyrocket-your-affiliate-registration-form-conversions-with-wpforms\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=2.11.0-release&utm_content=learn-more","text":"Learn More"},{"type":"secondary","url":"https:\\/\\/affiliatewp.com\\/skyrocket-your-affiliate-registration-form-conversions-with-wpforms\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=2.11.0-release&utm_content=start-now","text":"Start Now"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(4, 109, 'Introducing Improved Affiliate Registration Form Customization + reCAPTCHA v3 Compatibility', 'We’ve made it even easier to customize your affiliate registration forms. Try out the new <strong>Registration Form Blocks</strong> and add <strong>reCAPTCHA v3</strong> to streamline your affiliate signup process today!', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/registration-forms-just-got-10x-easier-to-customize\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=2.10.0-release&utm_content=learn-more","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(5, 100, 'Introducing a Tutor LMS Integration + Updates to Email Summaries', 'You now have even more ways to add affiliate marketing to your LMS thanks to our new Tutor LMS integration, enabling you to grow course sales with all of our innovative affiliate features. Plus, we’ve got an exciting update to email summaries!', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/introducing-tutor-lms-integration-for-affiliatewp\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=2.9.8-release&utm_content=learn-more","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(6, 93, 'Protect Your Program with the New Fraud Prevention Pro Addon', '<span style="font-weight: 400;">The new Fraud Prevention pro addon is now live! Take control of your affiliate fraud prevention with this powerful new feature today by upgrading to the Pro plan.</span>', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/account\\/downloads\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=fraud-prevention-addon&utm_content=upgrade-now","text":"Upgrade Now"},{"type":"secondary","url":"https:\\/\\/affiliatewp.com\\/introducing-fraud-prevention-addon\\/?utm_source=wordpress&utm_medium=plugin-notification&utm_campaign=fraud-prevention-addon&utm_content=learn-more-personal-plus","text":"Learn More"}]', 'success', '["personal","plus"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(7, 86, 'Introducing Affiliate Email Summaries + LearnDash Integration', 'Automatically engage and motivate your affiliates with monthly email summaries. PLUS, easily integrate with the LearnDash learning management system and earn more money from your courses!', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/introducing-affiliatewp-2-9-7-affiliate-summaries-and-learndash-integration\\/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=AffiliateWP 2.9.7&utm_content=Learn%20More","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(8, 79, 'Introducing Terms of Use Generator + Monthly Email Summaries', 'Affiliate management just got easier! AffiliateWP now includes a Terms of Use Generator that creates your affiliate terms of use in seconds and Monthly Email Summaries to keep you up to date with your program’s performance. Click “Learn More” to get full details about AffiliateWP 2.9.6!', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/introducing-affiliatewp-2-9-6\\/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=introducing-affiliatewp-2-9-6&utm_content=Learn%20More","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03'),
(9, 61, 'Hello World: Welcome to AffiliateWP Notifications 👋', 'You’ve found our new Plugin Notification feature!\r\n\r\nThis is where we’ll send you all the important information you need.\r\n\r\nSo, for updates, new features, discounts, and supersecret tips, keep an eye on your new inbox!\r\n\r\nJust click the action buttons to engage further with the message, and hit dismiss when you’ve consumed all the pearls of wisdom.\r\n\r\nWe look forward to using this feature to help you grow your business.\r\n\r\nSincerely,\r\n\r\nThe AffiliateWP team.', '[{"type":"primary","url":"https:\\/\\/affiliatewp.com\\/announcing-plugin-notifications\\/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=welcome-to-affiliatewp-notifications&utm_content=Learn%20More","text":"Learn More"}]', 'success', '["personal","plus","professional","ultimate"]', '2023-02-13 20:55:01', NULL, 0, '2023-02-16 03:08:03', '2023-02-16 03:08:03') ;
